class Solution:

    def minimumVisitedCells(self, grid: List[List[int]]) -> int:
        m = len(grid)
        n = len(grid[0])
        self.min_cells = float('inf')

        def dfs(i: int, j: int, visited: int) -> None:
            if i == m - 1 and j == n - 1:
                self.min_cells = min(self.min_cells, visited)
                return
            for k in range(j + 1, min(j + grid[i][j] + 1, n)):
                dfs(i, k, visited + 1)
            for k in range(i + 1, min(i + grid[i][j] + 1, m)):
                dfs(k, j, visited + 1)
        dfs(0, 0, 1)
        return self.min_cells if self.min_cells != float('inf') else -1

data_validator.code:
def is_valid_input(grid: List[List[int]]) -> bool:
    if not grid:
        return False
    (m, n) = (len(grid), len(grid[0]))
    if not 1 <= m <= 10 ** 5 or not 1 <= n <= 10 ** 5 or (not 1 <= m * n <= 10 ** 5):
        return False
    for row in grid:
        if not len(row) == n:
            return False
        for value in row:
            if not 0 <= value < m * n:
                return False
    if grid[m - 1][n - 1] != 0:
        return False
    return True

