def random_test(max_rows: int=10, max_cols: int=10, max_value: int=100) -> List[List[List[int]]]:

    def gen_input() -> List[List[int]]:
        m = random.randint(1, max_rows)
        n = random.randint(1, max_cols)
        grid = [[random.randint(0, min(m * n - 1, max_value)) for _ in range(n)] for _ in range(m)]
        grid[m - 1][n - 1] = 0
        if is_valid_input(grid):
            return grid
        else:
            return gen_input()
    return [gen_input() for _ in range(5)]

code_baseline.code:
class Solution:

    def minimumVisitedCells(self, grid: List[List[int]]) -> int:
        m = len(grid)
        n = len(grid[0])
        dp = [[float('inf')] * n for _ in range(m)]
        dp[0][0] = 1
        for i in range(m):
            for j in range(n):
                max_steps = grid[i][j]
                for k in range(j + 1, min(n, j + max_steps + 1)):
                    dp[i][k] = min(dp[i][k], dp[i][j] + 1)
                for k in range(i + 1, min(m, i + max_steps + 1)):
                    dp[k][j] = min(dp[k][j], dp[i][j] + 1)
        return dp[m - 1][n - 1] if dp[m - 1][n - 1] != float('inf') else -1
